import infernape from './imagenes/infernape.jpg';
import raiquaza from './imagenes/raiquaza.jpg';
import swampert from './imagenes/swampert.jpg';
import victini from './imagenes/victini.jpg';

const pokemons = [
    {
      src: infernape,
      player: 'Infernape'
    },
    {
      src: infernape,
      player: 'Infernape'
    },
    {
      src: raiquaza,
      player: 'Rayquaza'
    },
    {
        src: raiquaza,
        player: 'Rayquaza'
      },
    {
      src: swampert,
      Player: 'Swampert'
    },
    {
        src: swampert,
        Player: 'Swampert'
    },
    {
      src: victini,
      player: 'Victini'
    },
    {
      src: victini,
      player: 'Victini'
    },
  ];
  
  export { pokemons }
